import NavBar from "./NavBar";
import ToDoList from "./ToDoList";
import {BrowserRouter, Switch, Route} from 'react-router-dom'


class App extends React.Component{
    render(){
        return(
            <section id="todo">
                <BrowserRouter>
                </BrowserRouter>
                    <Switch>
                    </Switch>

                <ToDoList />
                <NavBar />
            </section>
        )
    }
}

export default App
